import { GET_ZHEIMER_ERROR, GET_ZHEIMER_SUCCESS } from "../actions/actionTypes";

const initialState = {
  zheimers: [],
  newzheimer: {},
  error: null,
};

export default function zheimerReducer(state = initialState, action) {
  switch (action.type) {
    case GET_ZHEIMER_SUCCESS:
      return {
        ...state,
        genres: action.payload,
      };

    case GET_ZHEIMER_ERROR:
      return {
        ...state,
        error: action.error,
      };

    default:
      return state;
  }
}
